import React from "react";
import {Row, Col, Card, CardBody, Container} from "reactstrap";
//Import Breadcrumb
import Breadcrumbs from "../../components/Common/Breadcrumb";

const ConfidenceLevels = () => {
	return (
		<React.Fragment>
			<div className="page-content">
				<Container fluid>
					<Breadcrumbs title="Niveles de confianza" />
					<Row>
						<Col xl="6">
							<Card>
								<CardBody>
									<h4 className="card-title">Nivel 1</h4>
									<p>
										personas de confianza extrema como familiares y mejores
										amigos.
									</p>
								</CardBody>
							</Card>
						</Col>
						<Col xl="6">
							<Card>
								<CardBody>
									<h4 className="card-title">Datos personales</h4>
								</CardBody>
							</Card>
						</Col>
					</Row>
				</Container>
			</div>
		</React.Fragment>
	);
};

export default ConfidenceLevels;
